export function getUserDetails(token) {
  let user;
  switch (localStorage.getItem('test')) {
    case 'Student':
      user = studentDetails;
      break;
    case 'University':
      user = universityDetails;
      break;
    case 'Company':
      user = companyDetails;
      break;
    default:
      break;
  }
  return new Promise((resolve) => setTimeout(() => resolve(user), 1000));
}

